import { Dropvalue } from "./dropcontext"

function Dropdisplay(){
    const {drop}=Dropvalue()
    console.log(drop)
    return(
        <>
        <ul>
            {drop.map((car,i)=>(
                <li className="cars" key={i}>{car}</li>
            ))}
        </ul>
            
        </>
        
    )
}

export default Dropdisplay
